"use strict";(self.webpackChunkftcwebsite=self.webpackChunkftcwebsite||[]).push([[8130],{7735:a=>{a.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"Konec za\u010detnega poskusa","metadata":{"permalink":"/blog/Konec za\u010detnega poskusa","source":"@site/blog/2023-02-15-konec-zacetnega-poskusa/index.md","title":"Konec za\u010detnega poskusa","description":"swag-IMG1514-scaled-e1678047964690-930x620.jpg","date":"2023-02-15T00:00:00.000Z","tags":[{"inline":false,"label":"FTC 2022","permalink":"/blog/tags/ftc-2022","description":"First Tech Challenge 2022"}],"readingTime":5.265,"hasTruncateMarker":true,"authors":[{"name":"David Zindovi\u0107","page":{"permalink":"/blog/authors/david-zindovic"},"key":"david-zindovic"}],"frontMatter":{"slug":"Konec za\u010detnega poskusa","title":"Konec za\u010detnega poskusa","authors":["david-zindovic"],"tags":["ftc-2022"]},"unlisted":false,"nextItem":{"title":"Barve prijateljstva","permalink":"/blog/Barve prijateljstva"}},"content":"![swag-IMG_1514-scaled-e1678047964690-930x620.jpg](img/swag-IMG_1514-scaled-e1678047964690-930x620.jpg)\\r\\n\\r\\nZadnji dan prvega regijskega tekmovanja v Bukare\u0161ti je napo\u010dil. Dolgemu prebujanju, obilnemu zajtrku in spremljanju\\r\\nromunskih elektri\u010darjev na delu je sledila pot do mesta na\u0161ih poslednjih tekem za leto\u0161njo sezono. Smehu popotni\u0161kih \u0161al\\r\\nje sedilo ogrevanje v obliki manj\u0161ih popravkov na robotu in v samem programu. \x3c!-- truncate --\x3e Dokaj kmalu se je pri\\r\\nna\u0161i mizi oglasil prostovoljec z opozorilom za \u010dakalno vrsto na\u0161e tekme. Tokrat smo igralnemu polju pristopili ob strani\\r\\nekipe Evolution (#19131) na strani rde\u010de alianse. S strategijo skovano \u017ee prej\u0161nji dan smo se ob zvoku troblje podali v\\r\\nigro z zaporedno \u0161tevilko 96. Tokrat smo \u010dutili dodatno napetost, saj smo nasprotovali kolegom iz ekipe CSH(#17861).\\r\\nKljub strategiji in koordiniraem sodelovanju smo bili preprosto nekoliko po\u010dasnej\u0161i od nasprotne barve in smo bili ob\\r\\nzaklju\u010dnem pisku kratki ze nekaj to\u010dk.\\r\\n\\r\\n![IMG_1703-scaled.jpg](img/IMG_1703-scaled.jpg)\\r\\n\\r\\nNastopajo\u010di \u010dlani posadke so se vrnili k mizi zadovoljni in motivirani. Do naslednje tekme je ostalo kar nekaj \u010dasa,\\r\\nzato smo se odlo\u010dili za obisk kolegov in nova spoznanstva. Spoprijateljili smo se z ekipo RoSofija. Debata o robotu in\\r\\nprogramu je prerasla v dobro prijateljstvo. Podarili so nam tudi romunsko razli\u010dico Jafa pi\u0161kotov, ki so bili prijeten\\r\\nprigrizek. Kasneje tekom dogodka so se oglasili \u0161e pri na\u0161i mizi in se pogovarjali z nami o trenutnem stanju dr\u017eave in\\r\\nnjeni zgodovini. Najbolj smo se spoprijateljili s \u010dlanoma Frumo in Sebi.\\r\\n\\r\\n![20230215_123830-scaled.jpg](img/20230215_123830-scaled.jpg)\\r\\n\\r\\nKmalu je minilo tudi kosilo in s tem tudi \u010das do na\u0161e zadnje kvalifikacijske tekme, z zaporedno \u0161tevilko 115. \u0160e vedno s\\r\\npritrjenim red\u010dim kvadratom na strani robota smo pravo\u010dasno dognali strategijo z ekipo Gentlemen (#17857). Tokrat smo\\r\\nposlednji\u010d pripeli svoje Driver in Coach bro\u0161ke na dres in se napotili k igralnemu polju. Za\u010detka sirena je kmalu\\r\\nspustila svoj zvok, ki mu je sledila uspe\u0161na avtonomna faza za obe ekipi rde\u010dih. Medtem ko smo poslu\u0161ali s strani\\r\\ngledalcev \u201cHaj ro\u0161u\u201d (\u201cdajmo rde\u010di\u201d), smo manevrirali kar se je le dalo optimalno po polju in se dr\u017eali dogovorjene\\r\\n\u201ccircuit\u201d stratgije. Z uspe\u0161no napeljanim vezjem in zadovoljivim \u0161tevilom to\u010dk smo uspeli kon\u010dati na\u0161 nastop na\\r\\ntekmovanju First Tech Challenge v uspe\u0161ni lu\u010di.\\r\\n\\r\\n![IMG_1428-scaled.jpg](img/IMG_1428-scaled.jpg)\\r\\n\\r\\nKmalu po na\u0161i zadnji igri se je za\u010del izbor alians za polfinale tekmovanja. Vedno ve\u010d prisotnih se je nabiralo okoli\\r\\nigralnih polj, na balkonih in stopnicah, da so lahko spremljali pofinale in finale v \u017eivo, \u010detudi s pogledom na veliki\\r\\nekran. Napetost in hrup sta se le stopnjevala, kar je doprineslo k vzdu\u0161ju samih iger, ki so bile v slogu \\"prva ekipa do\\r\\ndveh dobljenih iger, zmaga\\" (best of three).\\r\\n\\r\\n![20230215_151021-scaled.jpg](img/20230215_151021-scaled.jpg)\\r\\n\\r\\nKo je hrup publike in pihal usahnil, smo se premaknili s sosednji paviljon, kjer se je odvila slavnostna podelitev\\r\\nnagrad. Dogodek je vklju\u010deval nam tuji jezik (brez podnapisov), ploskanje in navijanje za na\u0161e prijatelje, ko so le ti\\r\\nosvojili nagrado. Po prijetnem dogodku smo se \u0161e zadnji\u010d za ta dogodek sestali z na\u0161im prijateljem Christianom, s komer\\r\\nsmo si uspeli izmejati \u0161e nekaj besed.\\r\\n\\r\\n![IMG_1594-scaled.jpg](img/IMG_1594-scaled.jpg)\\r\\n\\r\\nHitro smo ugotovili kaj je slede\u010de na sporedu za la\u010dne in utrujene tekmovalce in tekmovalke, kaj drugega kot pa ve\u010derja!\\r\\nPo kraj\u0161em obisku hotelskih soban smo se odpravili v nam \u017ee znan Carefour Express nakupovalni center. Tekom odlo\u010danja\\r\\nmed ponudniki hitre hrane so do nas pristopili na\u0161i kolegi iz ekip DarkEnergy in DecebalTech. Pogovor je tekel o manj\\r\\ntekmovalnih tematikah, predvsem pa o hrani in sredi\u0161\u010du mesta. Dolgemu pogovoru je sledilo \u0161e dalj\u0161e poslavljanje, ki se\\r\\nje pa vendarle kon\u010dalo z obilo nasmehov. Na koncu smo se v veliki ve\u010dini odlo\u010dili za obisk restavracije ChopStix, razen\\r\\nza nekatere, ki so se odlo\u010dili za obisk ponunika Popeye\u2019s. S polnimi trebuhi in dobrotami za na pot smo se odpravili do\\r\\nnajbli\u017eje postaje za podzemni vlak.\\r\\n\\r\\n![IMG_1683-scaled.jpg](img/IMG_1683-scaled.jpg)\\r\\n\\r\\nS pomo\u010djo enostavnega sistema in voznega reda smo se kmalu uspeli usesti na vlak, ki nas je za le par minut v zameno za\\r\\ndobre pol evra pripeljal do sredi\u0161\u010da mesta, natan\u010dneje v bli\u017eino znamenitosti, ki je prva na na\u0161em seznamu \u2013 parlament.\\r\\nNa poti do povr\u0161ja smo se sre\u010dali tudi s simulacijo Krasa, natan\u010dneje vetrov le tega. Nekaj minut hoje nas je pripeljalo\\r\\ndo drugega najve\u010djega parlamenta na svetu, ki smo si ga lahko ogledali s parkinga, ki je primerno oddaljen od sprednje\\r\\nstrani zgradbe.\\r\\n\\r\\n![IMG_1684-scaled.jpg](img/IMG_1684-scaled.jpg)\\r\\n\\r\\nOgled mesta smo nadaljevali v smeri starega mestnega jedra, ki ga okra\u0161ujejo visoke zgradbe, sumljivo tema\u010dni podhodi in\\r\\nmalodane nere\u0161ljive Kirchoffove zanke. Ozke ulice so na sre\u010do imele veliko manj\u0161ih zemljevidov za la\u017ejo orientacijo,\\r\\ntako da smo lahko brez te\u017eav si ogledali znamenitosti kot je Nacionalni muzej. Zaradi omejitev glede transporta smo\\r\\nmorali pohiteti in smo na poti lahko ujeli le \u0161e nekaj zaprtih trgovin, cerkev, nacionalni muzej umetnosti, trg univerze\\r\\nin kip sede\u010dega mo\u0161kega (Iuliu Maniu). Hitre noge so nas pravo\u010dasno pripeljale do postaje ob reki, nato pa nas je vlak\\r\\nodpeljal nazaj do okolice nakupovalnega sredi\u0161\u010da Carefour.\\r\\n\\r\\n![20230215_230358-scaled.jpg](img/20230215_230358-scaled.jpg)\\r\\n\\r\\nToplina hotelskih soban nas je spravila v stanje udobja in nas spodbudila k \u0161e zadnjemu ve\u010dernemu dru\u017eenju v Romuniji,\\r\\nki je pa \u017eal bilo delno okra\u0161eno tudi z pakiranjem orodja in lokalnih energijski pija\u010d. Kmalu je napo\u010dil \u010das za spanec,\\r\\nvendar za nekatere prej kot za ostale. Novo jutro je s seboj prineslo nove avanture. Zaradi popoldanskega leta smo se\\r\\nodlo\u010dili, da po sre\u010danju z dvema prostovoljcema in zamenjavi majc, obi\u0161\u010demo znamenitost v neposrednji bli\u017eini \u2013 jezero\\r\\nLacul Morii. Po zajtrku in oddaji kartic ter prtljage smo se napotili na ogled omenjene znamenitosti. Pot do tja smo\\r\\nnapeljali skozi park, ki ga je skupaj z njegovo okolico na\u010del \u010das in nas je spomnil na sovjetski slog. Igrala in\\r\\ndogajanje sta bila, kljub zelo prijetnemu son\u010dnemu vremenu, precej nenavdu\u0161ujo\u010da, \u010de ne \u0161tejemo voja\u0161ke opreme\\r\\nrazstavljene v parku. Samo jezero je pa ob\u010dutno ve\u010dje od parka, obdaja ga pa teka\u0161ka steza in oboki v slogu moderne\\r\\numetnosti, ki so slu\u017eili kot preizkus hitrosti s pomo\u010djo golobov. Na oddaljenem koncu je bilo mo\u017eno opaziti manj\u0161i\\r\\npolotok, na katerem so ostanki starodavnih stebrov.\\r\\n\\r\\n![IMG-20230216-WA0001.jpg](img/IMG-20230216-WA0001.jpg)\\r\\n\\r\\n![IMG_1696-scaled.jpg](img/IMG_1696-scaled.jpg)\\r\\n\\r\\nKmalu smo se vrnili v hotel, kjer nam je le \u0161e preostalo \u010dakanje naro\u010denega Uberja in klic Sina Valentina. Prevoz do\\r\\nletali\u0161\u010da nam je ponudil ponovno izku\u0161njo romunskih vozni\u0161kih spretnosti ter ogled znamenitosti kot sta Slavolok zmage (\\r\\nArcul de Triumf) in Muzej va\u0161ke zgodovine. Sre\u010danju na letali\u0161\u010du je sledilo \u010dakanje in checkin ter pojasnitev, da v\\r\\n\u0161katli za robota vendarle niso buteljke vina. Tekom potovanja smo tudi objavili zahvalni video namenjen na\u0161im tokratnim\\r\\npodpornikom, Zavarovalnici Triglav.\\r\\n\\r\\n![IMG_1713-scaled.jpg](img/IMG_1713-scaled.jpg)\\r\\n\\r\\nDo prihodnji\u010d,<br></br>\\r\\nsalut"},{"id":"Barve prijateljstva","metadata":{"permalink":"/blog/Barve prijateljstva","source":"@site/blog/2023-02-14-barve-prijateljstva/index.md","title":"Barve prijateljstva","description":"IMG1535-scaled-e1677781579598-930x620.jpg","date":"2023-02-14T00:00:00.000Z","tags":[{"inline":false,"label":"FTC 2022","permalink":"/blog/tags/ftc-2022","description":"First Tech Challenge 2022"}],"readingTime":6.075,"hasTruncateMarker":true,"authors":[{"name":"David Zindovi\u0107","page":{"permalink":"/blog/authors/david-zindovic"},"key":"david-zindovic"}],"frontMatter":{"slug":"Barve prijateljstva","title":"Barve prijateljstva","authors":["david-zindovic"],"tags":["ftc-2022"]},"unlisted":false,"prevItem":{"title":"Konec za\u010detnega poskusa","permalink":"/blog/Konec za\u010detnega poskusa"},"nextItem":{"title":"Nazaj v Ibis!","permalink":"/blog/Nazaj v Ibis!"}},"content":"![IMG_1535-scaled-e1677781579598-930x620.jpg](img/IMG_1535-scaled-e1677781579598-930x620.jpg)\\r\\n\\r\\nZ razgledom na vzhajajo\u010de sonce in bli\u017enje bloke ter cerkev smo za\u010deli drugo jutro na\u0161ega obiska Bukare\u0161te. Mo\u010dnemu\\r\\nzajtrku je sledil sprehod do dvorane na\u0161e primarne dejavnosti popotovanja. Namesto razteznih vaj smo se lotili popravil\\r\\nna robotu in pokanja prstov z udarjanjem tipk na tipkovnici. \x3c!-- truncate --\x3e Prilagajanje nastavitev tipk igralnega\\r\\nplo\u0161\u010dka voznikovim \u017eeljam in izdelava avtonomnega delovanja robota sta zaposlila programerski del ekipe do pri\u010detka\\r\\nin\u0161pekcij in kvalifikacijskih iger. Pregledu robota je sledil zagovoru na\u0161ih v\u010deraj\u0161njih pisnih del, ki je bil za\u010dinjen\\r\\ns priimkom na\u0161ega biatlonca in delnim razpadom samega robota. Za tem smo pa bili dele\u017eni tudi preizkusa delovanja robota\\r\\nna igralnem polju, pri \u010demer nas je oviralo delovanje avtonomnega dela. Z manj\u0161imi popravki smo uspe\u0161no prestali\\r\\npreizkus in se osredoto\u010dili na naslednje izzive, kljub prepovedi spreminjanja robota. Sre\u010da je bila na na\u0161i strani in\\r\\nna\u0161o prvo tekmo premaknila na drugi dan, kar nam je omogo\u010dilo uvedbo popravkov. Delovanje robota je bilo stabilizirano\\r\\nin dvi\u017eni mehanizem je bil izbolj\u0161an glede na na\u0161e zahteve. Na\u0161a nastopajo\u010da ekipa \u2013 David T. (voznik), Ana (sovoznica),\\r\\nDavid Z. (coach) \u2013 so se prvi dan udele\u017eili sestanka, ki je bil namenjen raz\u010di\u0161\u010devanju mo\u017enih nejasnosti in ponovitvi\\r\\npravil. Vodja ekipe David T. je tudi pravo\u010dasno stopil do na\u0161ih sotekmovalcev na modri strani in se pomenil o sami\\r\\nstrategiji igre, ki jo bo na\u0161a dvojica robotov \u017eelela izvesti.\\r\\n\\r\\n![20230214_075421-scaled.jpg](img/20230214_075421-scaled.jpg)\\r\\n\\r\\nNa\u0161a prva kvalifikacijska igra (\u0161tevilka 16 na senzamu) je bila igrana v sodelovanju z ekipo CYB3RG0DS (#22998), ki se\\r\\njo kon\u010dala z zmago na\u0161e alianse z rezultatom 107 proti 89. Z obilo ve\u010d ob\u010dutka za samo igro (in upravljanje robota) smo\\r\\nse vrnili k preostanku ekipe in se nemudoma lotili potrebnih popravkov, kmalu za tem pa tudi ponovno kovanje strategij.\\r\\n\\r\\n![20230213_110243-scaled.jpg](img/20230213_110243-scaled.jpg)\\r\\n\\r\\nZ vmesnimi po\u010ditki in sprehodi tekom katerih smo \u010dlani ekipe VegaMind spoznali nove ljudi in ustvarili prijateljstva.\\r\\nNa\u0161i najbolj\u0161i prijatelji so bili sprva kar na\u0161i sosedi, ekipa BrutForce (#22941). Tekom spoznavanja smo bili\\r\\npresene\u010deni nad \u0161tevilom \u010dlanov/-ic nekaterih ekip, ki je seglo tudi do 17 brez mentorjev. Barvitost, logotipi, darila\\r\\nin manj\u0161e debate so krasile hodnik, ki je vodil od vhoda v stavbo do sredi\u0161\u010da dogajanja. Med ekipami smo sre\u010dali (in\\r\\nspoznali) svetovne prvake tekmovanja FTC sezone 2021/2022 \u2013 Delta Force. Njihov robot je bil vsekakor izstopajo\u010d in je\\r\\ndeloval s pomo\u010djo mehanizma podobnega \u017eerjavu. Postali smo tudi dobri prijatelji z nekaterimi \u010dlani ekipe CSH, predvsem\\r\\npa nihom govornikom Cristiejem, saj je le on rade volje prihajal do nas in se pogovarjal.\\r\\n\\r\\n![IMG_1530-scaled.jpg](img/IMG_1530-scaled.jpg)\\r\\n\\r\\nUre so minevale vedno hitreje, podobno kot so se vedno hitreje premikali roboti na poljih. Napo\u010dila je na\u0161a druga tekma\\r\\nFTC kariere (zaporedna \u0161tevilka 38), na kateri smo nastopili ponovno na modri strani, vendar tokrat z ekipo Bots\u2019\\r\\nBrain (#19081). Nekoliko slab\u0161a koordinacija in smola sta nam prinesli zgolj 41 to\u010dk, kar pa ni bilo dovolj za zmago.\\r\\nUtrujeni smo se vrnili na na\u0161e mesto in po\u010dasi upali na prihod hrane, ki nas je kljub obupnem okusu uspela napolniti za\\r\\nnekaj \u010dasa.\\r\\n\\r\\nTekom preizku\u0161anja robota smo spoznali nekaj \u010dlanov iz ekipe Decebal Tech. Njihov programer Matej je na\u0161i kodirni\\r\\nposadki pokazal nekaj zlata vrednih virov, in sicer Road Runner ter program za umetno inteligenco. Prvi je namenjen\\r\\nolaj\u0161anju dela programerjem, ki \u017eelijo dose\u010di da se robot giblje po zahtevnej\u0161i krivulji. Drugi pa omogo\u010di enostavnej\u0161e\\r\\nprepoznavanje slike, kar je osrednji del avtonomne faze igre, saj nam postavitev na pravilnem delu polja (v odvisnosti\\r\\nod slike na sto\u017ecu) prinese dodatne to\u010dke. Skupaj z viri smo izvedeli tudi informacijo, da ve\u010dina programerjev na\\r\\ndogodku ne \u201cizumlja tople vode\u201d, saj je tekmovanje na stopnji Romunije tako razvito, da je velika ve\u010dina programskih\\r\\nre\u0161itev dostopnih kar na spletu. Po programerskem razsvetljenju smo spoznali \u0161e kolege omenjene ekipe, in sicer ekipo\\r\\nDarkEnergy(#19106), ki jo sestavljajo dijaki in dijakinje iste \u0161ole, vendar ni\u017ejih letnikov.\\r\\n\\r\\n![20230213_193900-scaled.jpg](img/20230213_193900-scaled.jpg)\\r\\n\\r\\nProsti \u010das najhitreje mine, tako je tudi kmalu do nas pristopil prostovoljec Liviu, ki je kasneje postal na\u0161 prijatelj,\\r\\nin nas opozoril, da je potrebno iti v vrsto za naslednjo igro (zaporedna \u0161tevilka 53). \u0160e vedno s plavim krogom pripetim\\r\\nna stran na\u0161ega robota smo se ob strani kolegov iz ekipe November Eleven (#21073) podali v nov dvoboj. Tokrat se nam je\\r\\nzgodil huj\u0161i spodrsljal, robota nismo mogli upravljati. Zaradi senzorja, ki se ni spro\u017eil, je bil vozniku onemogo\u010den\\r\\ndostop do robota. Potreben je bil le udarec po glavi, vendar je dotikanje robota med igro strogo prepovedano. Mu\u010dni 2\\r\\nminuti sta se vlekli, \u017eal pa nismo mogli nikakor pomagati na\u0161im kolegom. Z le 42 to\u010dkami smo segli v roke istoobarvanih\\r\\nter prav tako rde\u010dih in s sloganom \u201cgracious professionalism\u201d na mislih odkorakali nazaj do \u010dakajo\u010dih. Malo bi bilo\\r\\nre\u010di, da sta programerja imela kar nekaj dela. Na sre\u010do je bila te\u017eava hitro odpravljena, kar smo tudi skrbno\\r\\npreizku\u0161ali na polju.\\r\\n\\r\\n![IMG_1517-scaled.jpg](img/IMG_1517-scaled.jpg)\\r\\n\\r\\nTekom hekti\u010dnega dneva smo prejeli obisk s strani romunske razli\u010dice ekipi priljubljenega profesorja \u2013 Christiana! S\\r\\npozitivno energijo in nekoliko poenostavljeno angle\u0161\u010dino nas je pozdravil in se nam zahvalil, da smo pri\u0161li. \u017dal je kot\\r\\neden izmed osrednjih organizatorjev in sodnikov bil zelo zaseden in ni mogel ostati na dalj\u0161em obisku, vendar smo pa\\r\\nbili veseli da je pri\u0161el mimo. Zdaj pa nazaj na delo!\\r\\n\\r\\n![IMG_1679-scaled.jpg](img/IMG_1679-scaled.jpg)\\r\\n\\r\\nVse hitreje se je bli\u017eala zadnja igra drugega dneva tekmovanja FTC. Igra, ki je zabele\u017eena z zaporedno \u0161tevilko 70, je\\r\\nbila zadnji izziv pred zaslu\u017eenim po\u010ditkom. Z zamenjavo modrega kroga za rde\u010di kvadrat smo stopili ob stran \u010dlanov ekipe\\r\\nHYPERCUBE (#20925). S solidno strategijo in umirjenim pristopom smo prisluhnili glasnim (zelo glasnim) piskom siren in\\r\\nhrupu ljudstva. Avtonomni del programa se je pravilno izvedel. Vozniki so po 30-ih sekundah pograbili igralne plo\u0161\u010dke in\\r\\nusmerili pogled na zmago. \u017deljeni manevri in skromno \u0161tevilo zlo\u017eenih sto\u017ecev je barvalo za\u010detek igre v umetnino. Ob\\r\\nnatikanju petega sto\u017eca na oddaljeno palico, ki nam je ovirala pogled, se je zgodila usodna napaka \u2013 sto\u017eec je padel v\\r\\nrobota. Ker igra prepoveduje no\u0161enje ve\u010d kot enega sto\u017eca isto\u010dasno, samo bili prisiljeni odstraniti sto\u017eec iz\\r\\nnotranjosti robota, pri \u010demer nam niso uspeli pravo\u010dasno pomagati kolegi. Preostanek igre smo se posku\u0161ali otresti\\r\\nsvojih napak, vendar zaman, saj nas je prehitel kon\u010dni pisk. Sodnikov nasmeh in spo\u0161tovanje sta nam bila znak, da je\\r\\npotrebno glavo nositi pokonci. Konec napornega dneva je napo\u010dil, vendar tokrat smo se odlo\u010dili oditi pred deseto ve\u010derno\\r\\nuro nazaj v hotel.\\r\\n\\r\\n![20230215_092259-scaled.jpg](img/20230215_092259-scaled.jpg)\\r\\n\\r\\nPo kraj\u0161em obisku soban smo se odpravili v te\u017eko pri\u010dakovani nakupovalni center \u2013 Afi Cotroceni. Do tja nas je\\r\\npripeljala potka skozi park in pre\u010dkanje romunske upodobitve Celov\u0161ke ceste. Modra krogla in pove\u010dano \u0161tevilo ljudi sta\\r\\nnam dala vedeti da nismo dale\u010d od na\u0161ega cilja. Sestradani smo se prvo pognali v lov na hrano, no, natan\u010dneje\\r\\nrestavracije. Tik po odkritju drsali\u0161\u010da, zip line-a in ve\u010djega \u0161tevilka restavracij na istem mestu smo na\u0161li napravo, ki\\r\\ns pomo\u010djo robotske roke ustvari sladkorno peno v obliki srca na palici. Po dalj\u0161em odlo\u010danju med ponudniki resnej\u0161ega\\r\\nobroka smo se odlo\u010dili za NoodlePack, razen ljubitelji koko\u0161jega mesa, ki so pristali v \u010dakalni vrsti za KFC.\\r\\n\\r\\n![IMG_1493-scaled.jpg](img/IMG_1493-scaled.jpg)\\r\\n\\r\\n![IMG_1492-scaled.jpg](img/IMG_1492-scaled.jpg)\\r\\n\\r\\nVe\u010derji je sledil sprehod skozi zgradbo in dalj\u0161i obisk knjigarne z dru\u017eabnimi igrami ter platami. Ogled smo kon\u010dali z obiskom trgovine, kjer smo si privo\u0161\u010dili vsak nekaj dobrot v zameno za nekaj kraljev \u017eivali. Pot nazaj je bila obdana s smehom, spotikanjem in interpretacijo moderne umetnosti. Kmalu smo bili nazaj v hotelu, vendar dale\u010d od mest za sanjarjenje.\\r\\n\\r\\nDo prihodnji\u010d,<br></br>\\r\\najaje"},{"id":"Nazaj v Ibis!","metadata":{"permalink":"/blog/Nazaj v Ibis!","source":"@site/blog/2023-02-13-nazaj-v-ibis/index.md","title":"Nazaj v Ibis!","description":"IMG1460-scaled-e1677431342971-930x620.jpg","date":"2023-02-13T00:00:00.000Z","tags":[{"inline":false,"label":"FTC 2022","permalink":"/blog/tags/ftc-2022","description":"First Tech Challenge 2022"}],"readingTime":2.28,"hasTruncateMarker":true,"authors":[{"name":"David Zindovi\u0107","page":{"permalink":"/blog/authors/david-zindovic"},"key":"david-zindovic"}],"frontMatter":{"slug":"Nazaj v Ibis!","title":"Nazaj v Ibis!","authors":["david-zindovic"],"tags":["ftc-2022"]},"unlisted":false,"prevItem":{"title":"Barve prijateljstva","permalink":"/blog/Barve prijateljstva"}},"content":"![IMG_1460-scaled-e1677431342971-930x620.jpg](img/IMG_1460-scaled-e1677431342971-930x620.jpg)\\r\\n\\r\\nKmalu po povratku domov je padla ekipna odlo\u010ditev za skok v mrzlo vodo \u2013 \u017eelja po udele\u017eitvi na tekmovanju First Tech\\r\\nChallenge (v nadaljevanju FTC). Evropske ekipe smo nekoliko omejene s kvalifikacijskimi turnirji, zato nas je pot\\r\\npopeljala v Bukare\u0161to, glavno mesto Romunije. \x3c!-- truncate --\x3e Z obilo neprespanih no\u010di in razhro\u0161\u010denih dni smo se\\r\\nusedli na letalo, ki\\r\\nnas je z vmesnim postankom v Beogradu odpeljal do Bukare\u0161te. Ta nas je do\u010dakala z taksisti\u010dno zmedo, ki sta jo re\u0161ila\\r\\nUber in popravljalec klim Sin Valentin. Nepripeti vo\u017enji in ogledu polovice znamenitosti mesta med potjo je sledila\\r\\nnastanitev v hotelu Ibis, verigi pri kateri smo se udoma\u010dili \u017ee pri obisku \u017deneve! \u017de v avli smo sre\u010dali nekaj na\u0161ih\\r\\nsotekmovalcev. Zaradi dokaj poznega prihoda in zaupanja nevrednemu izgledu okolice smo se odlo\u010dili prvo no\u010d v Romuniji\\r\\npre\u017eiveti z obiskom najbli\u017eje trgovine ter sprehodom do lokacije, kjer se bo v prihodnjih dneh odvijalo tekmovanje FTC.\\r\\n\\r\\n![IMG_1483-scaled.jpg](img/IMG_1483-scaled.jpg)\\r\\n\\r\\nPrednost lokacije preno\u010di\u0161\u010da je ta, da se zbudimo na razdalji 10 minutnega sprehoda od zgradbe Politechnica University\\r\\nof Bucharest, ki se nahaja na \u0161tudentskem kampusu skupaj z obilo drugih in\u017eenirsko obarvah fakultet. FIRST-ovsko obarvan\\r\\nhodnik in gru\u010da \u017eivahnih sotekmovalcev sta nam namignila k temu, da smo na pravem mestu. Po sprehodu do vadbenih polj,\\r\\nki se nahajajo v bli\u017eini osrednjih tekmovalnih polj in odra smo na\u0161li v neposredni bli\u017eini tudi mizo oz. \u201c\u0161tand\u201d na\u0161e\\r\\nekipe, VegaMind #22903. Ogledu je sledilo spreminjanje napisa na vegovskih obla\u010dil v VegaMind, kar nam je omogo\u010dil\\r\\nlepilni trak.\\r\\n\\r\\n![IMG_1425-scaled.jpg](img/IMG_1425-scaled.jpg)\\r\\n\\r\\nPo povratku v najve\u010dji sobo od treh nas je \u010dakal kup dela s pisanjem dokumentacije, natan\u010dneje pisnih prispevkov\\r\\n\u201cEngineering Notebook\u201d in \u201cTeam Portfolio\u201d. Praksa bedenja do poznih ur se je izkazala kot uporabna vendarle pri igranju\\r\\ndru\u017eabne igre eksplozivnih muck.\\r\\n\\r\\n![20230213_084739-scaled.jpg](img/20230213_084739-scaled.jpg)\\r\\n\\r\\nPo obilnem zajtrku smo na\u0161i pisni deli dokon\u010dali in s prijazno pro\u0161njo naprintal na recepciji hotela. Jutro je bilo\\r\\ndelovno obarvano, saj nam je dostop do poligona omogo\u010dil dopolnjevanje programskih re\u0161itev. Poleg omenjenih obveznosti\\r\\nsmo se lotili tudi popravil na samem robotu, na katerem smo odkrili nekaj pomankljivosti. Poskusne vo\u017enje so nam\\r\\nprikazale resni\u010dne zmogljivosti robota, in sicer da lahko ciljamo zgolj talne spoje in najni\u017eje palice. Do\u010dakali smo\\r\\ntudi uvodno otvoritev, ki je bila sicer v romun\u0161\u010dini, vendar smo uspeli prispevati tudi mi z donacijo \u201cdresa\u201d za skupno\\r\\nfotografijo.\\r\\n\\r\\n![IMG_1469-scaled.jpg](img/IMG_1469-scaled.jpg)\\r\\n\\r\\nPrvi dan je poleg in\u017eenirskih dejavnosti prinesel tudi dru\u017eabne, saj smo se spoprijateljili z nekaterimi ekipami in si\\r\\nogledali robote na\u0161ih sotekmovalcev, pogled na katere je pognal pot po na\u0161ih \u010delih.\\r\\n\\r\\n![IMG_1449-scaled.jpg](img/IMG_1449-scaled.jpg)\\r\\n\\r\\nDelo do poznih ur smo nagradili z obiskom bli\u017enjega nakupovalnega centra Carrefour Orhideea, v katerem smo si privo\u0161\u010dili\\r\\nprvi\u010d videne napitke in raziskali svet romunskih prigrizkov. Sprehodu do hotela je sledilo na\u010drtovanje novega dne in \u0161e\\r\\n\u0161\u010depec dela.\\r\\n\\r\\n![20230213_215106-scaled.jpg](img/20230213_215106-scaled.jpg)\\r\\n\\r\\nDo prihodnji\u010d,<br></br>\\r\\ntakle mamo"}]}}')}}]);